        return context
    }

    @SuppressLint("SuspiciousIndentation")
    fun SubstrateCallFunction(rpcUrl: String, SEED: String, SEED1: String, pb: Int, era: String, tip: String, datahash: String):String{
        var callReturn = ""

            try {


                val provider = SubstrateProvider(rpcUrl)

                val genesisHash = provider.getHash(0).blockingGet()

                val Runtime = provider.getRuntimeVersion().blockingGet()

                val specVersion = Runtime["specVersion"]
                val transactionVersion = Runtime["transactionVersion"]


                val SEED_BYTES = Hex.decode(SEED)
                val signKeypair = SubstrateKeypairFactory.generate(EncryptionType.SR25519, SEED_BYTES)
                val publickey = signKeypair.publicKey.toHex()
                val ss58key = signKeypair.publicKey.toSS58()

                val SEED_BYTES1 = Hex.decode(SEED1)
                val signKeypair1 = SubstrateKeypairFactory.generate(EncryptionType.SR25519, SEED_BYTES1)
                val publickey1 = signKeypair1.publicKey.toHex()
                val ss58key1 = signKeypair1.publicKey.toSS58()

                var call = ""
                if(pb == 0) {
                     call = "0700" + "0900" + publickey1
                }
                if(pb == 1){
                    call = "0901" + publickey1
                }
                if(pb == 2){
                     call = "0902" + publickey
                }
                if(pb == 3){
                    call = "0a00" + "0000"+datahash
                }


                // How many prior transactions have occurred from this account? This
                // Helps protect against replay attacks or accidental double-submissions.
                val nonce = SendCall(provider, ss58key).blockingGet()
                //assertEquals(hex, afterIo)
                val extra = era + nonce.toString().toLong().toCompactU8a().toHex() + tip
                // This TX won't be valid if it's not executed on the expected runtime version:
                val specversion = specVersion.toString().toInt().toU8a().toHexString()
                val transactionversion = transactionVersion.toString().toInt().toU8a().toHexString()
                // Genesis hash, so TX is only valid on the correct chain:
                val genesishash = genesisHash.removePrefix("0x")
                // The block hash of the "checkpoint" block. If the transaction is
                // "immortal", use the genesis hash here. If it's mortal, this block hash
                // should be equal to the block number provided in the Era information,
                // so that the signature can verify that we're looking at the expected block.
                // (one thing that this can help prevent is your transaction executing on the
                // wrong fork; same genesis hash but likely different block hash for mortal tx).
                val blockhasherablock = genesisHash.removePrefix("0x")

                val additonal = specversion + transactionversion + genesishash + blockhasherablock

                var message = call + extra + additonal

                val messageBytes = message.fromHex()


                val signatureWrapper = Signer.sign(
                    MultiChainEncryption.Substrate(EncryptionType.SR25519),
                    messageBytes,
                    signKeypair
                )

                val signature = signatureWrapper.signature.toHexString()
                val bitpublickey = "00"
                val bitSignature = "01"
                val extrinsicVersion = "84"
                val extrinsic =
                    extrinsicVersion + bitpublickey + publickey + bitSignature + signature + extra + call
                val extlengt =
                    ((extrinsic.length)/2).toCompactU8a()
                        .toHex()
                val extrinsicFinal = "0x"+extlengt + extrinsic

                println(extrinsicFinal)
                //val testo = getValueTest(provider,"0").blockingGet()
                val extrinsicReturn = io.nodle.substratesdk.PostExtrinsicP(provider, extrinsicFinal)
                    .blockingGet()


                println(extrinsicReturn)
                if(pb == 0) {
                    callReturn = "Factory created"
                }
                if(pb == 1){
                    callReturn = "The vehicle is created"
                }
                if(pb == 2){
                    callReturn = "The vehicle is initialized"
                }
                if(pb == 3){
                    callReturn = "An accient has ben reported with success"
                }
            }
            catch (e: Exception) {
                callReturn = "an error occured"

            }

        return callReturn
    }

